import { useEffect } from 'react';
import './App.css';
const axios = require("axios");

const App = () => {
  const [data, setData] = use
  useEffect(() => {
    const fetchData = async () => {
      const options = {
        method: "POST",
        url: "https://symptom-checker4.p.rapidapi.com/analyze",
        params: {
          symptoms: "I have dots on my upperbody it's red but doesn't heart",
        },
        headers: {
          "content-type": "application/json",
          "X-RapidAPI-Key":
            "3bc4205b95msh053da429b4479cdp13dcd3jsn57e065230884",
          "X-RapidAPI-Host": "symptom-checker4.p.rapidapi.com",
        },
        data: {
          symptoms: "i can not do my exercises",
        },
      };

      try {
        const response = await axios.request(options);
        console.log(response.data);
      } catch (error) {
        console.error(error);
      }
    };
    fetchData();
  }, [])


  return (
    <>
      <h1>Hello</h1>
      <input type="text" />
      <h2></h2>
    </>
  )
}

export default App;
